    ACCOUNT: '/account',
}


export const Children = (path: string) => {
    const isLogin = useTypedSelector(state => state.account.login.login)
    console.log(isLogin);
    switch (path) {
        case Case.ACCOUNT:
            if(isLogin){return (<AccountTabsNavBar/>)}

            break;

        default:
            break;
    }

}
